import React from 'react';
import './css/Photo.css';

const Photographs = () => {
  return (
    <div className="photographs-container">
      <div className="cards">
        <ul>
          <li onClick={() => window.location.href='/photograph1'}>
            <img src="your-image-url-1" alt="Photograph 1" />
            <p>Photograph 1 Description</p>
          </li>
          <li onClick={() => window.location.href='/photograph2'}>
            <img src="your-image-url-2" alt="Photograph 2" />
            <p>Photograph 2 Description</p>
          </li>
          <li onClick={() => window.location.href='/photograph3'}>
            <img src="your-image-url-3" alt="Photograph 3" />
            <p>Photograph 3 Description</p>
          </li>
          {/* Add more cards as needed */}
        </ul>
      </div>
    </div>
  );
};

export default Photographs;
